//Return the size 1 or 2
public static int readUtf8_len(byte[] src, int p, int[] ret){
    byte b = src[p];
    if ((0x80 & b) != 0) {
        ret[0] = (b & 0x7f) << 8 | (src[p + 1] & 0xFF);
        return 2;
    } else {
        ret[0] = b & 0xFF;
        return 1;
    }
}

