//Return the size 1 or 2
public static int readUtf8_len(byte[] src, int p, int[] ret) 
{
    int b0 = src[p] & 0xFF;
    if (b0 < 0x80) {
        ret[0] = 1;
        return 1;
    } else if ((b0 & 0xE0) == 0xC0) {
        ret[0] = 2;
        return 2;
    } else {
        throw new IllegalArgumentException("Invalid UTF-8 start byte: " + Integer.toHexString(b0));
    }
}

