/**
 * Process hexadecimal integer.
 */
private int readHex(int max) 
{
    int ch = read();
    if (ch == -1)
        return -1;
    if (ch >= '0' && ch <= '9')
        return ch - '0';
    if (ch >= 'A' && ch <= 'F')
        return ch - 'A' + 10;
    if (ch >= 'a' && ch <= 'f')
        return ch - 'a' + 10;
    return -1;
}

