 */
private TQuantifier processQuantifier(int ch) 
{
    TQuantifier quantifier = null;

    switch (ch)
    {
        case '?':
            quantifier = TQuantifier.ZeroOrOne;
            break;
        case '*':
            quantifier = TQuantifier.ZeroOrMore;
            break;
        case '+':
            quantifier = TQuantifier.OneOrMore;
            break;
    }

    return quantifier;
}

