/**
 * short
 * @param sh short
 * @return 
 */
public static byte[] valueOf(short sh){
	byte[] shortBuf = new byte[2];
	for(int i=0;i<2;i++) {
		int offset = (shortBuf.length - 1 -i)*8;
		shortBuf[i] = (byte)((sh>>>offset)&0xff);
	}
	return shortBuf;
}

