/**
 * +()
 * 
 * @param length
 *            
 * @param caseSensitivity
 *            
 * @return 
 */
public static String captchaChar(int length, boolean caseSensitivity){
    StringBuilder sb = new StringBuilder();
    Random rand = new Random();// 
    Random randdata = new Random();
    int data = 0;
    for (int i = 0; i < length; i++) {
        int index = rand.nextInt(caseSensitivity ? 3 : 2);
        // 
        switch (index) {
        case 0:
            data = randdata.nextInt(10);// 0~9, 0~9ASCII48~57
            sb.append(data);
            break;
        case 1:
            data = randdata.nextInt(26) + 97;// ASCII97~122(a-z),
            sb.append((char) data);
            break;
        case 2: // caseSensitivitytrue, 
            data = randdata.nextInt(26) + 65;// ASCII65~90(A~Z)
            sb.append((char) data);
            break;
        }
    }
    return sb.toString();
}

