                    .equalsIgnoreCase("false"))) {
        return false;
    } else if (object.equals(Boolean.TRUE)
            || (object instanceof String && ((String) object)
                    .equalsIgnoreCase("true"))) {
        return true;
    }
    throw new JSONException("JSONArray[" + index + "] is not a boolean.");
}

