/**
 * 
 * 1. 
 * 2. num[i] -min 
 * 3. 
 * @param nums
 */
public static void sort(int[] nums) 
{
    int max = Integer.MIN_VALUE;
    int min = Integer.MAX_VALUE;
    for(int num : nums)
    {
        max = Math.max(max, num);
        min = Math.min(min, num);
    }
    int bucketNum = max - min + 1;
    int[] bucket = new int[bucketNum];
    for(int num : nums)
    {
        bucket[num - min]++;
    }
    int idx = 0;
    for(int i = 0; i < bucketNum; i++)
    {
        while(bucket[i] > 0)
        {
            nums[idx++] = i + min;
            bucket[i]--;
        }
    }
}

