 */
public int getMaxValueOfPackage3(int n, int m, int[] v, int[] val, int[] nums) 
{
    int[][][] dp = new int[n+1][m+1][m+1];
    for(int i=1; i<=n; i++)
    {
        for(int j=1; j<=m; j++)
        {
            for(int k=1; k<=m; k++)
            {
                if(j<v[i])
                {
                    dp[i][j][k] = dp[i-1][j][k];
                }
                else
                {
                    dp[i][j][k] = Math.max(dp[i-1][j][k], dp[i-1][j-v[i]][k-1]+val[i]);
                }
            }
        }
    }
    return dp[n][m][m];
}

