{
    try
    {
        StringBuilder buffer = new StringBuilder();
        char[] tmp = new char[1024];
        int l;
        while ((l = reader.read(tmp)) != -1)
        {
            buffer.append(tmp, 0, l);
        }
        return buffer.toString();
    }
    finally
    {
        reader.close();
    }
}

