public void fillBucket (Key id, KBucket bucket, Consumer<NodeLookup> configure) 
{
    if (bucket.isFull())
        return;

    List<Node> nodes = new ArrayList<>(bucket.getNodes());
    Collections.shuffle(nodes);

    for (Node n : nodes)
    {
        if (bucket.isFull())
            return;

        if (n.getID().equals(id))
            continue;

        NodeLookup nl = new NodeLookup(id, n);
        configure.accept(nl);
        nl.start();
    }
}

