public static String camelCase(String key){
    StringBuilder sb = new StringBuilder(key.length());
    boolean upper = true;
    for (int i = 0; i < key.length(); i++) {
        char c = key.charAt(i);
        if (upper) {
            sb.append(Character.toUpperCase(c));
        } else {
            sb.append(Character.toLowerCase(c));
        }
        upper = c == '-';
    }
    return sb.toString();
}

