    {
        for (int i = mPostponedTransitions.size() - 1; i >= 0; i--)
        {
            final TransitionView transitionView = mPostponedTransitions.get(i);
            if (transitionView.isReady())
            {
                transitionView.startTransition();
                mPostponedTransitions.remove(i);
            }
        }
    }
}

