// Polyfill for String.join
public static String stringJoin(String delimiter, String[] list) 
{
    StringBuilder sb = new StringBuilder();
    boolean first = true;
    for (String s : list)
    {
        if (first)
        {
            first = false;
        }
        else
        {
            sb.append(delimiter);
        }
        sb.append(s);
    }
    return sb.toString();
}

