private void numToBinaryArray(int[] binaryArray, int num){
	int index = 0;
	int temp = 0;
	while (num != 0) {
		binaryArray[index] = num % 2;
		index++;
		num /= 2;
	}

	//
	for(int i=0; i<binaryArray.length/2; i++){
		temp = binaryArray[i];
		binaryArray[i] = binaryArray[binaryArray.length - 1 - i];
		binaryArray[binaryArray.length - 1 - i] = temp;
	}
}

